import React from 'react'
import Navbar from '../Navbar/Navbar'

const Layout = () => {
    return (
        <div className='layout'>
            <Navbar />
            <div className='main'>
            <span className='tag'>&lt;body&gt;</span>
            </div>
        </div>
    )
}

export default Layout
